if (!("spellcheck_data" in localStorage)) {
	localStorage.setItem("spellcheck_data", "");
}

function saveData() {
	var storage_data = document.getElementById("content").innerHTML;
	if (storage_data.length > 10) {
		localStorage.setItem("spellcheck_data", storage_data);
		var element = document.getElementById("message");
		element.innerHTML = "Saved";
		setTimeout(function() {element.innerHTML = "";}, 1000);
	}
}

function deleteData() {
	localStorage.setItem("spellcheck_data", "");
	document.getElementById("content").innerHTML = "";
}

function loadData() {
	var element = document.getElementById("message");
	var storage_data = localStorage.getItem("spellcheck_data");
	if (storage_data.length > 0) {
		document.getElementById("content").innerHTML = storage_data;
		element.innerHTML = "Loaded saved data";
	}
	setTimeout(function() {element.innerHTML = "";}, 2000);
}

if (!("removed_words" in localStorage)) {
	localStorage.setItem("removed_words", JSON.stringify(["ابتثج","ئویے"]));
}

function checkSpell() {
	var content = document.getElementById("content").innerHTML;
	// linebreaks
	content = content.replace(/<div>/gi, " (lb) ").replace(/<\/div>/gi, "");
	content = content.replace(/<br>/gi, " (lb) ");
	// strip tags
	content = content.replace(/<\/?[^>]+(>|$)/g, "");
	// replace &nbsp;
	content = content.replace(/\s/g, " ");
	content = content.replace(/&nbsp;/g, " ");

	// removed words in local storage
	var removed_words_storage = localStorage.getItem("removed_words");
	var removed_words = JSON.parse(removed_words_storage);
	
	var words = content.split(" ");
	for (var i = 0; i < words.length; i++) {

		var original_word = words[i];
		var cleaned_word = clean_word(original_word.trim());

		if (
				!(cleaned_word in urdu_dictionary) && !(cleaned_word in localStorage) 
				|| removed_words.indexOf(cleaned_word) > -1 // removed by user, so format it even it is in the dictionary
			)
		{
			words[i] = "<em>" + original_word + "</em>";
		}
		if (cleaned_word in doubtfuls) {
			words[i] = "<b>" + original_word + "</b>";
		}
	}
	
	var words_result = words.join(" ");
	words_result = words_result.split(" <em>(lb)</em> ").join("<br>");
	document.getElementById("content").innerHTML = words_result;
	
	document.getElementById("setting-icons").style.visibility = "visible";;
}

function clean_word(word) {
	// remove double quotes first
	var marks = ["ؐ", "ؑ", "ؒ", "ؓ", "ّ", "ٖ", "ٰ", "’’", "‘‘", "’", "‘", "۔", "'", "،", "ُ", "ْ", "َ", "ِ", "ٗ", "ـ", "؟", "/", "\\", "ٌ", "ٔ", ")", "(", "“", "”", "!", ":", ";", "؎", "ؔ", "ً", "ٍ", "-", ",", ".", "_", "`", "!", "~", "@", "#", "$", "%", "^", "&", "*", "+", "=", "\\", "{", "}", "[", "]", "/", "<", ">", "'", "\"", "?", "|"];
	for (var i = 0; i < marks.length-1; i++) {
		word = word.replace(marks[i], "");
	}
	return word;
}

function addword() {
	
	var word = document.getElementById("user_word").value.trim();
	
	var removed_words_storage = localStorage.getItem("removed_words");
	var removed_words = JSON.parse(removed_words_storage);	
	if (removed_words.indexOf(word) > -1) {
		removed_words.splice(removed_words.indexOf(word), 1);
		localStorage.setItem("removed_words", JSON.stringify(removed_words));
	}
	
	if (word != "") {
		if (!(word in urdu_dictionary)) {
			localStorage.setItem(word, word);
		}
		alert("‘" + word + "’" 	+ " ڈکشنری میں شامل کر دیا گیا ہے۔");
		document.getElementById("user_word").value = "";
		document.getElementById("user_word").focus();

	}
}

function removeword() {
	
	var removed_words_storage = localStorage.getItem("removed_words");
	var removed_words = JSON.parse(removed_words_storage);
		
	var word = document.getElementById("user_word").value.trim();
	if (word != "") {
		if (removed_words.indexOf(word) < 0) {
			removed_words.push(word);
			localStorage.setItem("removed_words", JSON.stringify(removed_words));
			alert("‘" + word + "’" + " ڈکشنری سے خارج کر دیا گیا ہے۔");
			document.getElementById("user_word").value = "";
			document.getElementById("user_word").focus();
		} else {
			alert("‘" + word + "’" + " ڈکشنری میں سے پہلے سے خارج ہے۔");
		}
	}
}

var boxes_on = 0;
function toggleBoxes() {
	if (boxes_on == 0) {
		boxes_on = 1;
		var ems = document.getElementsByTagName("em");
		for (var i = 0; i < ems.length; i++) {
			ems[i].style.paddingRight = "5px";
			ems[i].style.paddingLeft = "5px";
			ems[i].style.borderWidth = "1px";
			ems[i].style.borderStyle = "solid";
			ems[i].style.marginRight = "4px";
		}
	} else {
		boxes_on = 0;
		var ems = document.getElementsByTagName("em");
		for (var i = 0; i < ems.length; i++) {
			ems[i].style.paddingRight = "0";
			ems[i].style.paddingLeft = "0";
			ems[i].style.borderWidth = "0";
			ems[i].style.marginRight = "0";
		}
	}
}

